import logo from './logo.svg';
import './App.css';

function Halo(props) {
  return(
    <div>
      <h1>Halo, apakabar {props.name}?</h1>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Halo name="niko"/>
      <Halo name="Joni"/>
    </div>
  );
}

export default App;
